pragma solidity 0.8.7;
pragma experimental ABIEncoderV2;
import "hardhat/console.sol";
interface IERC20 {
  function decimals() external view returns (uint256);

  function totalSupply() external view returns (uint256);

  function balanceOf(address account) external view returns (uint256);
}

abstract contract Ownable {
  address private _owner;

  constructor() {
    _owner = msg.sender;
  }

  function owner() public view virtual returns (address) {
    return _owner;
  }

  modifier onlyOwner() {
    require(owner() == msg.sender, "Ownable: caller is not the owner");
    _;
  }

  function transferOwnership(address newOwner) public virtual onlyOwner {
    require(newOwner != address(0), "Ownable: new owner is the zero address");
    _owner = newOwner;
  }
}

abstract contract Constant is Ownable {
  string internal UNKNOWN_STRING = "UNKNOWN";
  uint256 internal UNKNOWN_UINT256 = 0;

  function setUnKnownString(string memory _unknown) external onlyOwner {
    UNKNOWN_STRING = _unknown;
  }

  function setUnknownUint256(uint256 _unknown) external onlyOwner {
    UNKNOWN_UINT256 = _unknown;
  }
}

abstract contract Block {
  function getBlockHash(uint256 blockNumber) public view returns (bytes32 blockHash) {
    blockHash = blockhash(blockNumber);
  }

  function getBlockNumber() public view returns (uint256 blockNumber) {
    blockNumber = block.number;
  }

  function getCurrentBlockCoinbase() public view returns (address coinbase) {
    coinbase = block.coinbase;
  }

  function getCurrentBlockDifficulty() public view returns (uint256 difficulty) {
    difficulty = block.difficulty;
  }

  function getCurrentBlockGasLimit() public view returns (uint256 gaslimit) {
    gaslimit = block.gaslimit;
  }

  function getCurrentBlockTimestamp() public view returns (uint256 timestamp) {
    timestamp = block.timestamp;
  }

  function getLastBlockHash() public view returns (bytes32 blockHash) {
    blockHash = blockhash(block.number - 1);
  }

  function getBlockBaseFee() public view returns (uint256 baseFee) {
    require(getChainId() == 1, "Unable to get baseFee");
    baseFee = block.basefee;
  }

  function getChainId() public view returns (uint256 chainId) {
    chainId = block.chainid;
  }
}

abstract contract Pair is Constant {
  struct EachPair {
    address token;
    uint256 reserve;
  }

  struct PairReserves {
    address pair;
    EachPair token0;
    EachPair token1;
  }

  function safePairReserve(address pair) internal view returns (EachPair memory token0, EachPair memory token1) {
    (bool successToken0, bytes memory token0Bytes) = pair.staticcall(abi.encodeWithSelector(0x0dfe1681));
    require(successToken0, "getPairReserve: Invalid Token0");
    address token0Address = abi.decode(token0Bytes, (address));

    (bool successToken1, bytes memory token1Bytes) = pair.staticcall(abi.encodeWithSelector(0xd21220a7));
    require(successToken1, "getPairReserve: Invalid Token1");
    address token1Address = abi.decode(token1Bytes, (address));

    (bool successReserves, bytes memory reserve) = pair.staticcall(abi.encodeWithSelector(0x0902f1ac));
    require(successReserves, "getPairReserve: Invalid reserves");
    (uint256 token0Reserve, uint256 token1Reserve) = abi.decode(reserve, (uint256, uint256));

    return (EachPair({token: token0Address, reserve: token0Reserve}), EachPair({token: token1Address, reserve: token1Reserve}));
  }

  function getBatchPairReserves(address[] memory _pairs) public view returns (PairReserves[] memory _pairReserves) {
    _pairReserves = new PairReserves[](_pairs.length);
    for (uint256 i = 0; i < _pairs.length; i++) {
      address targetPair = _pairs[i];

      _pairReserves[i].pair = targetPair;
      (_pairReserves[i].token0, _pairReserves[i].token1) = safePairReserve(targetPair);
    }
  }
}

abstract contract Token is Constant {
  struct TokenInfo {
    string name;
    string symbol;
    uint256 decimals;
    uint256 totalSupply;
  }

  struct BalanceInfo {
    address token;
    uint256 balance;
  }

  function safeTokenName(address token) public view returns (string memory) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x06fdde03));
    return success ? abi.decode(data, (string)) : UNKNOWN_STRING; // abi.decode(data, (string)
  }

  function safeTokenSymbol(address token) public view returns (string memory) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x95d89b41));
    return success ? abi.decode(data, (string)) : UNKNOWN_STRING; // abi.decode(data, (string)
  }

  function safeTokenDecimals(address token) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x313ce567));
    return success ? abi.decode(data, (uint256)) : UNKNOWN_UINT256;
  }

  function safeTokenTotalSupply(address token) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x18160ddd));
    return success ? abi.decode(data, (uint256)) : UNKNOWN_UINT256;
  }

  function safeTokenBalanceOf(address token, address holder) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x70a08231, holder));
    return success ? abi.decode(data, (uint256)) : UNKNOWN_UINT256;
  }

  function getBatchTokenInfos(address[] memory _tokens) public view returns (TokenInfo[] memory tokenInfos) {
    tokenInfos = new TokenInfo[](_tokens.length);

    for (uint256 i = 0; i < _tokens.length; i++) {
      address targetToken = _tokens[i];
      tokenInfos[i] = TokenInfo({
        name: safeTokenName(targetToken), // optional
        symbol: safeTokenSymbol(targetToken), // optional
        decimals: IERC20(targetToken).decimals(), // required
        totalSupply: IERC20(targetToken).totalSupply() // required
      });
    }
  }

  function getBatchTokenBalances(address[] memory users, address[] memory tokens) external view returns (uint256[] memory addrBalances) {
    addrBalances = new uint256[](tokens.length * users.length);

    for (uint256 i = 0; i < users.length; i++) {
      for (uint256 j = 0; j < tokens.length; j++) {
        uint256 addrIdx = j + tokens.length * i;
        if (tokens[j] != address(0x0)) {
          addrBalances[addrIdx] = safeTokenBalanceOf(tokens[j], users[i]);
        } else {
          addrBalances[addrIdx] = users[i].balance;
        }
      }
    }
  }
}

abstract contract ChainLink is Constant {
  struct ChainLinkData {
    string description;
    uint256 answer;
    uint256 decimals;
  }

  function safeChainLinkData(address feed) public view returns (ChainLinkData memory) {
    (bool successDescriptionData, bytes memory desciprtionData) = feed.staticcall(abi.encodeWithSelector(0x7284e416));
    (bool successRoundData, bytes memory roundData) = feed.staticcall(abi.encodeWithSelector(0xfeaf968c));
    (bool successDecimalsData, bytes memory decimalsData) = feed.staticcall(abi.encodeWithSelector(0x313ce567));

    string memory description = successDescriptionData ? string(desciprtionData) : UNKNOWN_STRING;
    (, uint256 answer, , , ) = successRoundData
      ? abi.decode(roundData, (uint80, uint256, uint256, uint256, uint80))
      : (0, UNKNOWN_UINT256, 0, 0, 0);
    uint256 decimals = successDecimalsData ? abi.decode(decimalsData, (uint256)) : 0;

    return ChainLinkData({description: description, answer: answer, decimals: decimals});
  }

  function getBatchChainLinkData(address[] memory _targetFeeds) public view returns (ChainLinkData[] memory _chainLinkData) {
    _chainLinkData = new ChainLinkData[](_targetFeeds.length);
    for (uint256 i = 0; i < _targetFeeds.length; i++) {
      address targetFeed = _targetFeeds[i];
      _chainLinkData[i] = safeChainLinkData(targetFeed);
    }
  }
}

abstract contract Address {
  function getCode(address target) internal view returns (bytes memory code) {
    assembly {
      // retrieve the size of the code, this needs assembly
      let size := extcodesize(target)
      // allocate output byte array - this could also be done without assembly
      // by using o_code = new bytes(size)
      code := mload(0x40)
      // new "memory end" including padding
      mstore(0x40, add(code, and(add(add(size, 0x20), 0x1f), not(0x1f))))
      // store length in memory
      mstore(code, size)
      // actually retrieve the code, this needs assembly
      extcodecopy(target, add(code, 0x20), 0, size)
    }
  }

  function isCA(address target) internal view returns (bool) {
    uint256 code;
    assembly {
      code := extcodesize(target)
    }
    return code > 0;
  }

  function getBatchGetCode(address[] memory _targetAddress) public view returns (bytes[] memory code) {
    code = new bytes[](_targetAddress.length);
    for (uint256 i = 0; i < _targetAddress.length; i++) {
      code[i] = getCode(_targetAddress[i]);
    }
  }

  function getBatchCheckCA(address[] memory _targetAddress) public view returns (bool[] memory result) {
    result = new bool[](_targetAddress.length);
    for (uint256 i = 0; i < _targetAddress.length; i++) {
      result[i] = isCA(_targetAddress[i]);
    }
  }
}

abstract contract Aggregator {
  struct Call {
    address target;
    bytes callData;
  }

  struct Result {
    bool success;
    bytes returnData;
  }

  function aggregate(bool requireSuccess, Call[] memory calls) public returns (Result[] memory returnData) {
    returnData = new Result[](calls.length);
    for (uint256 i = 0; i < calls.length; i++) {
      (bool success, bytes memory ret) = calls[i].target.call(calls[i].callData);

      if (requireSuccess) {
        require(success, "multicall aggregate: call failed");
      }

      returnData[i] = Result(success, ret);
    }
  }

  function staticAggregate(bool requireSuccess, Call[] memory calls) public view returns (Result[] memory returnData) {
    returnData = new Result[](calls.length);
    for (uint256 i = 0; i < calls.length; i++) {
      (bool success, bytes memory ret) = calls[i].target.staticcall(calls[i].callData);

      if (requireSuccess) {
        require(success, "multicall aggregate: call failed");
      }

      returnData[i] = Result(success, ret);
    }
  }
}

contract MultiCall is Block, Pair, Token, Address, ChainLink, Aggregator {}

